                        <h5 className="card-title "> {this.props.reporte.libro.titulo} </h5>
                        <h5 className="card-title "> Lecturas:{this.props.reporte.cant} </h5>                   
                    </div>
                </div>
            </div>
        )
    }
}

export default ItemReporteLibros;
